<p>Deep Learning Lab (DLL) organised the industry gathering to present their research to the trade. The purpose of the event was to gain industry exposure for the pertinent items and evaluate the commercialisation prospects of the projects being carried out under DLL. The event assisted in creating the ideal framework for establishing links between academia and industry and helped to better understand end-user needs so that the research could be guided in the proper path.</p>
